import React from "react";
import {Text} from "react-native-paper";

export default function UnlockPremium(props) {
    return <View><Text>Unlock</Text></View>;
}

const styles = StyleSheet.create({
    container: { 
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        backgroundColor: "#121212",
        paddingTop: 16,
        paddingBottom: 16,
        flex: 1,
    },
});
